import  MenuItem  from './MenuItem';
import React from 'react';

class Menu extends React.Component {
    
    render() {
        return (
            <>
                <ul>
                    {this.props.list.map(item => (
                        <MenuItem key={item.id} icon={item.icon} item={item} />
                    ))}
                </ul>
            </>
        );
    }
}

export default Menu;
